import React from 'react';
import Card from 'react-bootstrap/Card';

function Cards({ item }) {
  return (
    <div className="">
      <Card>
        <img src={item.img} alt="" />
      </Card>
      <div className='d-flex flex'>
        <span className='fw-bold text-capitalize text-secondary'>{item.name}</span>
        <span className='text-secondary'>
          {item.desc}
        </span >
        <strong className=' text-success' class>N{item.price.toFixed(2)}</strong>
      </div>
    </div>
  );
}

export default Cards;
